import './App.css';
import React, { useState } from "react";
import accueil from'./accueil';

function Header() {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  return (
    <header className="bg-green-600 text-white">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <div className="flex-shrink-0">
            <link to ="/" className="text-2xl font-bold"></link>

              MonLogo
          </div>

          {/* Navigation pour écrans larges */}
          <nav className="hidden md:flex space-x-8">
            <link to ="/" className="hover:text-gray-200"></link>
              Accueil
            <link to ="/" className="hover:text-gray-200"></link>
              À propos
            <link to ="/" className="hover:text-gray-200"></link>
              Services
            <link to ="/" className="hover:text-gray-200"></link>
              Contact
          </nav>

          {/* Bouton pour le menu mobile */}
          <div className="md:hidden">
            <button
              onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
              className="focus:outline-none"
            >
              <svg
                className="h-6 w-6"
                xmlns="http://www.w3.org/2000/svg"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
                aria-hidden="true"
              >
                {isMobileMenuOpen ? (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M6 18L18 6M6 6l12 12"
                  />
                ) : (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M4 6h16M4 12h16m-7 6h7"
                  />
                )}
              </svg>
            </button>
          </div>
        </div>
      </div>

      {/* Menu mobile */}
      {isMobileMenuOpen && (
        <div className="md:hidden bg-green-700">
          <nav className="space-y-2 py-4 px-4">
            <a href="#" className="block text-white hover:bg-green-500 rounded px-3 py-2">
              Accueil
            </a>
            <a href="#" className="block text-white hover:bg-green-500 rounded px-3 py-2">
              À propos
            </a>
            <a href="#" className="block text-white hover:bg-green-500 rounded px-3 py-2">
              Services
            </a>
            <a href="#" className="block text-white hover:bg-green-500 rounded px-3 py-2">
              Contact
            </a>
          </nav>
        </div>
      )}
    </header>
  );
}
function App() {
  return (
    <div ><Header/> <accueil/> </div>

  );
}

export default App;
